import React from "react"
import { Link } from "react-router-dom"

const Footer = () => {
    return(
        <div className="footer">
            <h4 className="text-center">All Rights Reserved &copy; mankerbhumika</h4>
            <Link to="/about" className="text-center mt-3">About</Link>|<Link to="/contact" className="text-center mt-3">Contact</Link>|<Link to="/policy"className="text-center mt-3">Privacy Policy</Link>

        </ div>
    )
}

export default Footer
